CREATE TABLE `configuraciones`.`zona` (
    `id_zona` INT(11) UNSIGNED NOT NULL AUTO_INCREMENT ,
    `name` VARCHAR(30) NOT NULL ,
    `is_archived` ENUM('0','1') NOT NULL DEFAULT '0' ,
    PRIMARY KEY (`id_zona`),
    INDEX (`is_archived`)
) ENGINE = InnoDB;

CREATE TABLE `configuraciones`.`tipo` (
    `id_tipo` INT(11) UNSIGNED NOT NULL AUTO_INCREMENT ,
    `name` VARCHAR(50) NOT NULL ,
    `is_archived` ENUM('0','1') NOT NULL DEFAULT '0',
    PRIMARY KEY (`id_tipo`),
    INDEX (`is_archived`)
) ENGINE = InnoDB;

CREATE TABLE `configuraciones`.`ejercicio` (
    `id_ejercicio` INT(11) UNSIGNED NOT NULL AUTO_INCREMENT ,
    `name` VARCHAR(100) NOT NULL ,
    `video` VARCHAR(100) NULL ,
    `file` VARCHAR(100) NULL ,
    `id_zona` INT(11) UNSIGNED NOT NULL ,
    `id_tipo` INT(11) UNSIGNED NOT NULL ,
    `is_archived` ENUM('0','1') NOT NULL DEFAULT '0',
    PRIMARY KEY (`id_ejercicio`),
    INDEX (`is_archived`)
) ENGINE = InnoDB;


CREATE TABLE `media` (
     `id_media` int(11) UNSIGNED NOT NULL AUTO_INCREMENT,
     `associated_tb` varchar(128) COLLATE utf8mb4_unicode_ci NOT NULL,
     `associated_id` int(11) NOT NULL DEFAULT '0',
     `id_media_type` int(11) UNSIGNED DEFAULT '0',
     `id_mime_type` int(11) UNSIGNED DEFAULT NULL,
     `source` varchar(500) COLLATE utf8mb4_unicode_ci NOT NULL,
     `name` varchar(100) COLLATE utf8mb4_unicode_ci NOT NULL,
     `date` datetime NOT NULL,
     `is_archived` ENUM('0','1') NOT NULL DEFAULT '0',
     `archived_date` datetime DEFAULT NULL,
     PRIMARY KEY (`id_media`),
     INDEX (`id_mime_type`)
) ENGINE=InnoDB COMMENT='Archivos subidos a la plataforma';


CREATE TABLE `media_type` (
    `id_media_type` int(11) UNSIGNED NOT NULL,
    `description` varchar(45) NOT NULL,
    PRIMARY KEY (`id_media_type`)
) ENGINE=InnoDB COMMENT='Categoría del fichero';

INSERT INTO `media_type` (`id_media_type`, `description`) VALUES(1, 'Ejercicio animado'),(2, 'Ejercicio estático');

ALTER TABLE `media_type`
    MODIFY `id_media_type` int(11) UNSIGNED NOT NULL AUTO_INCREMENT, AUTO_INCREMENT=3;
COMMIT;


CREATE TABLE `mime_type` (
    `id_mime_type` int(11) UNSIGNED NOT NULL,
    `mime` varchar(100) COLLATE utf8mb4_unicode_ci NOT NULL,
    `extension` varchar(45) COLLATE utf8mb4_unicode_ci NOT NULL,
    `category` enum('font','message','text','chemical','model','multipart','image','video','pdf','x-conference','x-epoc','application','audio','other') COLLATE utf8mb4_unicode_ci NOT NULL DEFAULT 'other',
    PRIMARY KEY (`id_mime_type`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;

